import "./App.css";

function App() {
  const users = [
    { name: "Ahmed", age: 20 },
    { name: "Ruwaydah", age: 14 },
    { name: "Rayana", age: 14 },
  ];

  return (
    <div className="App">
      {users.map((user, key) => {
        return (
           <User name={user.name} age={user.age} />
        );
      })}
    </div>
  );
}

const User = (props) => {
  return (
    <div>
      {props.name} {props.age}
    </div>
  )
}
export default App;
